geregisseerd door Quentin Tarantino
met Kurt Russell, Rosario Dawson en Vanessa Ferlito

Voor Austins coolste DJ, Jungle Julia, biedt het vallen van de nacht de gelegenheid zich te ontspannen met haar beste vriendinnen, Shanna en Arlene. Van Guero&amp;#039;s tot aan de Texas Chili Parlor worden deze sexy chicks verlekkerd nagekeken. Niet alle aandacht is echter onschuldig: ongemerkt worden ze gevolgd door Stuntman Mike. Deze doorleefde rebel loert naar ze vanuit zijn opgevoerde Chevy Nova, en terwijl de meiden zich aan het bier zetten, loopt slechts enkele meters verder het toerental van Mike&amp;#039;s geheime wapen gevaarlijk hoog op....

